import React from "react";

export const Home = () => {
  return (
    <section>
      <h1>
        Hi, <br />
        I'm Yego, <br />A web developer.
      </h1>
      <p>Full Stack / JavaScript / Python / Java / Go</p>
      <button className="btn btn-primary">Contact me</button>
    </section>
  );
};
